import React from "react";

import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker,
} from "react-google-maps";

const Map = withScriptjs(
  withGoogleMap((props) => (
    <GoogleMap
      defaultZoom={8}
      defaultCenter={{ lat: 33.621526, lng: 72.948139 }}
    >
      <Marker position={{ lat: 33.621526, lng: 72.948139 }} />
    </GoogleMap>
  ))
);

export default Map;
